Immobiliare Atena propone in vendita una porzione di bifamiliare, nuova costruzione. L'immobile, posizionato nel centro del comune di Colleferro (RM), si sviluppa su più livelli componendosi di: piano seminterrato con garage, cantina e un bagno; al piano terra troviamo un portico, soggiorno con cucina a vista, una camera da letto e un bagno. Salendo si arriva alla zona notte, composta di tre camere da letto, una con bagno in camera, e un bagno. Completa la proprietà un terrazzo e un giardino di circa 400 mq. 
-Ottima posizione, in quanto permette il facile raggiungimento dei principali servizi;
-Data la composizione dell'immobile si prospetta un'ottima opportunità per le famiglie;
-Esposizione Ottimale;
-Nuova costruzione. 
Per ulteriori informazioni visitate il nostro sito WWW. IMMOBILIAR

